import React from "react";
import "./Home.css";
import Product from "./Product";

function Home() {
  return (
    <div className="home">
      <div className="home__container">
        <img
          className="home__image"
          src="https://images-eu.ssl-images-amazon.com/images/G/31/img20/Wireless/SamsungM/M51/8thSept_GW/P38983965_IN_WLME_SamsungGalaxy_M51_New_Launch_DesktopTallHero_2_3000x1200._CB405103024_.jpg"
          alt="homepage image"
        />
      </div>
      <div className="home__row">
        <Product
          id="1"
          title="The Lean Startup: How Constant Innovation Creates Radically Successful Businesses"
          price={12.99}
          image="https://images-na.ssl-images-amazon.com/images/I/51N-u8AsmdL._SY445_QL70_ML2_.jpg"
          rating={5}
        />
        <Product
          id="2"
          title="Apple iPhone 11 (64GB) - Black"
          price={599.9999}
          rating={4}
          image="https://store.storeimages.cdn-apple.com/4982/as-images.apple.com/is/iphone-xr-blue-select-201809?wid=940&hei=1112&fmt=png-alpha&qlt=80&.v=1565209264208"
        />
      </div>
      <div className="home__row">
        <Product
          id="3"
          title="Starbucks House Blend Medium Roast Ground Coffee, 200g"
          price={21.99}
          image="https://images-na.ssl-images-amazon.com/images/I/41KnROlFqdL.jpg"
          rating={4}
        />
        <Product
          id="4"
          title="Nomos Glashutte Metro Mens Manual Winding Date Wrist Watch Analog 38.5 mm Round Grey Dial with Sapphire Crystal and Black Leather Band 30m Water Resistant Business Genuine Luxury Watches - for Men"
          rating={5}
          price={1499}
          image="https://images-na.ssl-images-amazon.com/images/I/61Uph7KiloL._UX679_.jpg"
        />
        <Product
          id="5"
          image="https://images-na.ssl-images-amazon.com/images/I/61d26-znX1L._SX679_.jpg"
          title="Charcoal Grooming Kit By The Man Company | Packed In Elegant Wooden Gift Box | Set Of 6 - Body Wash, Shampoo, Face Scrub, Face Wash, Cleansing Gel, Soap Bar"
          rating={4}
          price={39.99}
        />
      </div>
      <div className="home__row">
        <Product
          id="6"
          image="https://assets.croma.com/medias/sys_master/images/images/h0c/hdf/8958856593438/227085-9_pjpeg.jpg"
          rating={5}
          price={20000}
          title="
Samsung 216 cm (85 inches) 8K Smart QLED TV QA85Q950TSKXXL (Stainless Steel) (2020 Model) | With Quantum 8K Processor"
        />
      </div>
    </div>
  );
}

export default Home;
